  FETCH c_rscquotas INTO L_rsc_id, L_rsc_type, L_expiryindays, L_quantity ;
  CLOSE c_rscquotas ;

  SET L_expirydate = ADDDATE(STR_TO_DATE(pstartdate,'%Y-%m-%d'),L_expiryindays) ;

  INSERT INTO awsaccounts ( accountid, loginemail, startdate, expirydate, status, tags) 
  VALUES (paccountid, ploginemail, pstartdate, L_expirydate, 'PRV', pawstags ) ;

  INSERT INTO awsresources ( accountid, resourcetypeid, startdate, expirydate, status) 
  VALUES (paccountid, 1, pstartdate, L_expirydate, 'PRV' ) ;

  RETURN 0 ;
END ;;
