CREATE DEFINER=`root`@`localhost` FUNCTION `search_items_by_text_json`(pitemstr VARCHAR(100)) RETURNS varchar(20000) CHARSET utf8mb3
    DETERMINISTIC
BEGIN
  declare L_catid INTEGER DEFAULT 1 ;
  declare L_itemcode INTEGER DEFAULT 1 ;
  declare L_itemdesc VARCHAR(100)  ;
  declare L_catdesc VARCHAR(100)  ;
  declare L_subitemdesc VARCHAR(100)  ;
  declare L_mainitemdesc VARCHAR(100)  ;
  declare L_itemrate DOUBLE ;
  DECLARE l_str VARCHAR(10000) DEFAULT '{"items" : [ ' ;
  DECLARE l_str2 VARCHAR(1000) DEFAULT '' ;
  DECLARE l_finished INTEGER DEFAULT 0 ;
  DECLARE l_count INTEGER DEFAULT 1 ;
  BEGIN
  DECLARE c_item CURSOR FOR 
	select cat.catid, cat.catdesc, i.ITEM_CODE, i.ITEM_DESC, ROUND(i.ITEM_RATE,2), si.SUB_ITEM_DESC, mi.MAIN_ITEM_DESC
	from itemcategories ic, categories cat, items i, sub_items si, main_items mi
	where cat.catid = ic.catid  
	and i.ITEM_CODE = ic.item_code 
    AND i.SUB_ITEM_CODE = si.SUB_ITEM_CODE
    AND si.MAIN_ITEM_CODE = mi.MAIN_ITEM_CODE
    AND UPPER(i.ITEM_DESC) LIKE CONCAT("%" , pitemstr , "%" )
	order by i.ITEM_DESC
  ;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET l_finished = 1 ;
  OPEN c_item ;

  get_no : LOOP

	FETCH c_item INTO L_catid, L_catdesc, L_itemcode, L_itemdesc, L_itemrate, L_subitemdesc, L_mainitemdesc ;
	IF l_finished = 1 THEN 
		LEAVE get_no ;
	END IF ;
	IF l_count > 1 THEN
		SET l_str := CONCAT(l_str , ',') ;
    END IF ;
	SET l_str := CONCAT(l_str , '{') ;
    SET l_str := CONCAT(l_str , '"itemid":' , L_itemcode, ',') ;
    SET l_str := CONCAT(l_str , '"itemdesc":"' , L_itemdesc, '" ,' ) ;
    SET l_str := CONCAT(l_str , '"itemrate":"' , L_itemrate, '" ,') ;
    SET l_str := CONCAT(l_str , '"subdesc":"' , L_subitemdesc, '" ,' ) ;
    SET l_str := CONCAT(l_str , '"mainbdesc":"' , L_mainitemdesc, '"' ) ;
    SET l_str := CONCAT(l_str , '}' ) ;
	SET l_count = l_count + 1 ;
	END LOOP get_no ;

  CLOSE c_item ;
  END ;
    SET l_str := CONCAT(l_str , ']}' ) ;

  
   RETURN l_str;

END ;;
